<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>2026 설날 인사</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@400;700&display=swap');
        
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Noto Sans KR', sans-serif;
            background: linear-gradient(135deg, #0a1128 0%, #1a1a3e 100%);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            padding: 20px;
        }
        
        .container {
            width: 100%;
            max-width: 700px;
        }
        
        .card {
            position: relative;
            width: 100%;
            border-radius: 16px;
            overflow: hidden;
            box-shadow: 0 15px 50px rgba(0, 0, 0, 0.4);
            background: white;
            margin-bottom: 40px;
        }
        
        .card-image {
            width: 100%;
            height: auto;
            display: block;
        }
        
        .card-overlay {
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            background: linear-gradient(to top, rgba(0, 0, 0, 0.4), transparent);
            padding: 50px 30px;
            text-align: center;
        }
        
        .card-overlay h1 {
            font-size: 52px;
            font-weight: 700;
            color: #daa520;
            margin-bottom: 8px;
            text-shadow: 2px 2px 8px rgba(0, 0, 0, 0.6);
            letter-spacing: 3px;
        }
        
        .card-overlay p {
            font-size: 28px;
            color: #f5f5dc;
            text-shadow: 1px 1px 4px rgba(0, 0, 0, 0.6);
            font-weight: 600;
            letter-spacing: 1px;
        }
        
        .footer-text {
            text-align: center;
            color: #bbb;
            font-size: 13px;
            line-height: 1.6;
            margin-top: 30px;
        }
        
        .footer-text p {
            margin-bottom: 8px;
        }
        
        .emoji {
            font-size: 24px;
            display: inline-block;
            margin-right: 8px;
        }
        
        .button-group {
            display: flex;
            gap: 15px;
            justify-content: center;
            flex-wrap: wrap;
            margin-top: 30px;
        }
        
        .btn {
            padding: 14px 32px;
            border: none;
            border-radius: 8px;
            font-size: 15px;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            font-family: 'Noto Sans KR', sans-serif;
        }
        
        .btn-download {
            background: linear-gradient(135deg, #daa520 0%, #b8860b 100%);
            color: white;
        }
        
        .btn-download:hover {
            transform: translateY(-3px);
            box-shadow: 0 8px 20px rgba(218, 165, 32, 0.5);
        }
        
        .btn-copy {
            background: rgba(255, 255, 255, 0.1);
            color: #daa520;
            border: 2px solid #daa520;
        }
        
        .btn-copy:hover {
            background: rgba(218, 165, 32, 0.2);
        }
    </style>
</head>

    <script>
        function downloadImage() {

        function copyLink() {
